const onAddMemberInfoButtonClick = () => {
    const link = "/add-info" + carnloughPath || cairndhuPath;
    window.location.assign(link);
};

const onBackButtonClick = () => {
    window.history.back();
};

const i = clubMemberData.clubs[0].carnlough[0].member.map((i) => i.times);
const stringifyContent = JSON.stringify(i);
const parsedContent = JSON.parse(stringifyContent);

class MemberAccount extends Component {
    render() {
        return (
            <>
                <Header />
                <div className='back-button'>
                    <LinkButtonBlack
                        text="< Back"
                        onClick={onBackButtonClick}
                    />
                </div>
                <div className='content-container'>
                    <h1 className='h2'>Member account</h1>
                    <h2>Name:</h2>
                    <p>{renderMemberData().memberName}</p>
                    <h2>Age group:</h2>
                    <p>{renderMemberData().ageGroup}</p>
                    <h2>Crew type:</h2>
                    <p>{renderMemberData().crewType}</p>
                    <h2>Times:</h2>
                    <p>{parsedContent}</p>
                    <PrimaryButton
                        text="Add info"
                        onClick={onAddMemberInfoButtonClick}
                    />
                </div>
                <Footer />
            </>
        );
    }
}

export default MemberAccount;
